  false,\n\t\"url\": null,\n\t\"notes\": \"In 1993, a constant-effort mist netting
  station (CEMN) was established on the Lee Metcalf National Wildlife Refuge as part
  of a network of monitoring stations for breeding landbird populations within the
  Bitterroot Valley of western Montana. In addition, mist netting data were contributed
  to the continent-wide CEMN program to monitor avian productivity and survivorship
  (MAPS) (DeSante 1991).  Locally, refuge personnel were interested in describing
  the composition and diversity of breeding landbirds found within riparian habitats
  along the Bitterroot River that runs through refuge, and to also describe local
  trends in population size and demographic features for important riparian obligates
  found the~ In this report I summarize the methods and results of the Lee Metcalf
  CEMN program for data collected annually from 1993 through 1998.\",\n\t\"license_title\":
